import "../css/index.css";

import { Link } from "react-router-dom";

export const Notfound = () => {
  return (
    <div className="notfound_page">
      존재하지 않는 페이지 입니다 <Link to={"/"}>무비앱으로 이동</Link>
    </div>
  );
};
